import React from "react";
import Card from "./Card";
import styled from "styled-components";
import bikeImg from "../BikeRGB.jpg"


export const products = [ 
  {product: "Bike", image: bikeImg},
  {product: "Tread", image: bikeImg},
  {product: "iOS", image: images[2].src},
  {product: "Apple Watch", image: images[3].src},
  {product: "Android", image: images[4].src},
  {product: "FireTV", image: images[5].src},
  {product: "Members", image: images[0].src}
];

function Home() {
  return (
    <>
      <PageTitle>Welcome to Peloton Members' Feedback App!
      <img src={products[0].image} />
      </PageTitle>
      {/* <PageContainer> */}
      <main style={{ padding: "20px" }} className="container">
        <div className="mx-auto">
          <ul className="row justify-content-left" margin="auto">
          {products.map(({product, image}, index) => (
            <Card product={product} image={image} key={index} />
          ))}
          </ul>
        </div>
        {/* </PageContainer> */}
      </main>
    </>
  );
};

const PageContainer = styled.main`
  flex: 1 0 auto;
  padding: 40px;
  class-name: container;
`;

const PageTitle = styled.h1`
  text-align: center;
`

export default Home;
